    false,nt"url": null,nt"notes": "The Coast Guard Sectors are delineated
    in the description in the 33 Code of Federal Regulations (CFR) for each Sector Boundary
    and Area of Responsibility where latitude and longitude coordinates, as well as
    county/state/national boundaries are included to describe the boundaries for each
    zone. In addition, whenever the Area of Responsibility boundary is over water, the
    EEZ shapefile is referenced for those occurrences. This layer displays the Coast
    Guard Sector Boundaries for the following sectorsAnchorage, Baltimore, Boston, Buffalo,
    Charleston, Columbia River, Corpus Christi, Delaware Bay, Detroit, Guam, Hampton
    Roads, Honolulu, Houston - Galveston, Humboldt Bay, Jacksonville, Juneau, Key West,
    Lake Michigan, Long Island Sound, Los Angeles - Long Beach, Lower Mississippi, Miami,
    Mobile, New Orleans, New York, North Bend, North Carolina, Northern New England,
    Ohio Valley, Puget Sound, San Diego, San Francisco, San Juan, Sault Ste Marie, Southeastern
